from pybricks.hubs import InventorHub
from pybricks.parameters import Color, Direction, Port, Stop
from pybricks.pupdevices import ColorSensor, Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
inventor_hub = InventorHub()
color_sensor__skibidi_ = ColorSensor(Port.E)
color_sensor__Fe_n_ = ColorSensor(Port.C)
Skibidi_arm_ = Motor(Port.A, Direction.CLOCKWISE)
spin = Motor(Port.D, Direction.CLOCKWISE)
Rizz_right_ = Motor(Port.B, Direction.CLOCKWISE)
Amongus_left_ = Motor(Port.F, Direction.COUNTERCLOCKWISE)
drive_base = DriveBase(Amongus_left_, Rizz_right_, 56, 162)

# Initialize variables.
ligma_list = []
Error = 0
P_fix = 0
Integral = 0
I_fix = 0
Last_Error = 0
Derivative = 0
D_fix = 0
Correction = 0
Skibidish_number = 0
sigmish__ = 45

async def Line(Distance, Speed, Side):
    global Error, P_fix, Integral, I_fix, Derivative, Last_Error, D_fix, Correction
    await wait(0)
    drive_base.reset(0, drive_base.angle())
    drive_base.use_gyro(False)
    while not Distance <= drive_base.distance():
        await wait(0)
        Error = 50 - await color_sensor__Fe_n_.reflection()
        P_fix = Error * 1.3
        if 0 == Error:
            Integral = 0
        Integral = 1 + Integral
        I_fix = Integral * 0.000001
        Derivative = Error - Last_Error
        Last_Error = Error
        D_fix = Derivative * 1.5
        Correction = P_fix + (I_fix + D_fix)
        drive_base.drive(Speed, Correction * Side)
    drive_base.straight(0)
    drive_base.use_gyro(True)

async def subtask():
    await wait(200)
    while True:
        await wait(0)
        if await color_sensor__skibidi_.color() != Color.NONE:
            await wait(100)
            ligma_list.append(await color_sensor__skibidi_.color())
            await wait(400)
            await spin.run_angle(100, 90)
            await wait(1000000)
        elif 15 < await color_sensor__skibidi_.reflection() and await color_sensor__skibidi_.color() == Color.NONE:
            ligma_list.append(Color.GREEN)
            await wait(400)
            await spin.run_angle(100, 90)
            await wait(1000000)
        else:
            pass

async def mcpentaagonarm(target_schmewgus, simgma_spedd):
    await wait(0)
    if Skibidi_arm_.angle() < 0:
        await Skibidi_arm_.run_angle(simgma_spedd, target_schmewgus - (Skibidi_arm_.angle() + 360))
    else:
        await Skibidi_arm_.run_angle(simgma_spedd, target_schmewgus - Skibidi_arm_.angle())

async def main1():
    pass

